"use strict";
$(document).ready(function () {
    var a = (document.getElementById("newuserchart").getContext("2d"));
    window.myDoughnut = new Chart(a, {
        type: "doughnut",
        data: {
            datasets: [{
                data: [85, 10, 5],
                backgroundColor: ["#9dcb3b", "#e3d735", "#fe976b"],
                label: "Dataset 1"
            }],
            labels: ["Satisfied", "Unsatisfied", "NA"],
        },
        options: {
            legend: {
                display: true,
                position: 'bottom',
            }
        }
    });
});